import React from "react";

function Loader() {
  return (
    <div className="cards rounded-md bg-[#ebf3fa]">
      <div className="dark-content w-[92%] h-40 m-2 rounded-md">
        {/* Your dark content goes here */}
      </div>
      <div className="m-2">
        <h1 className="font-medium shimmer"></h1>
        <h2 className="shimmer"></h2>
        <div className="w-14 rounded-lg text-center text-white shimmer"></div>
        <h2 className="text-lg shimmer"></h2>
      </div>
      {/* Shimmer effect applied as background */}
      <div className="shimmer"></div>
    </div>
  );
}

export default Loader;
